class logger(object):
    cmdFileName = 'log1'
    responseFileName='log2'
    _instance = None
    def __new__(cls, *args, **kwargs):
        if not cls._instance:
            cls._instance = super(logger, cls).__new__(
                                cls, *args, **kwargs)
        return cls._instance
    def __init__(self):
        self.cmdFile = open(self.cmdFileName,'a')
        self.responseFile = open(self.responseFileName,'a')
    def comandLog(self,cmd):
        pprint(cmd)
        pprint(cmd, self.cmdFile)
    def responseLog(self,cmd):
        pprint(cmd)
        pprint(cmd, self.responseFile)

class reader(object):
    '''
    foo(int, string) -> list
    '''
    debug=1
    @staticmethod
    def rawHandler(req):
        '''
        @rtype: dict
        '''
        return req[0]
    @staticmethod
    def getKeys(req):
        return reader.rawHandler(req).keys()
    @staticmethod
    def getValues(req):
        return reader.rawHandler(req).values()
    @staticmethod
    def read(req):
        print (req)
        if isinstance(req,str) or isinstance(req,int) or isinstance(req[0],int):
            print (req)
        elif isinstance(req,list) or isinstance(req,tuple):

            arr = [(str(i[0]),i[1]) for i in reader.rawHandler(req).items()]
            for x,y in arr:
                print (x,y)
        else:raise RuntimeError('unknow type of requst, this type is %s'%type(req))
    @staticmethod
    def r():
        return 1


