class auxMath():
    @staticmethod
    def addToDict(samedict:dict,key):
        """
        добовляет выражение в частотный словарь
        """
        if key is None:
            return samedict
        if key in samedict:
            samedict[key]+=1
        else:
            samedict[key]=1

    @staticmethod
    def findFrequentElem(samedict:dict):
        """
        находит максимальное значение в частотном словаре
        """
        max = 0
        keymax = ''
        for key,value in samedict.items():
            if value > max:
                max = value
                keymax = key
        return keymax

    @staticmethod
    def getMemberPair(samelist:dict, memberNumber=0):
        '''
        в словаре вида [(key,value),(key,value)] возвращает итератор Key`ев
        '''
        for pair in samelist:
            if len(pair) is 0:

                yield pair
            else:
                res = pair[memberNumber]
                if res is 0:
                    res = 'Неизвестно'
                yield res


    @staticmethod
    def findTopFreq(samedict:dict,sizeOfTop=3):
        """
        находит максимальное значение в частотном словаре
        """

        dateRange = [[] for i in range(sizeOfTop)]
        a={}
        for i, v in enumerate(dateRange):
            max = 0
            for key,value in samedict.items():
                if value > max and key not in auxMath.getMemberPair(dateRange):
                    max = value
                    dateRange[i] = (key,value)
        return dateRange

    @staticmethod
    def freqSelection(sameList:list):
        for i,v in enumerate(sameList):
            if v[1]*3 < sameList[i+1][1]:
                del sameList[i+1:]

